import logo from './logo.svg';
import './App.css';
import ExpensesComponent from './ExpensesComponent';
import ExpensesItemComponent from './ExpensesItemComponent';
import ExpensesDateComponent from './ExpenseDate';
import ExpensesCardComponent from './CardComponent';

const expenses = [
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];


function App() {

  let expensesList = [];

  expenses.forEach((expense, index) => {
    expensesList.push(
        ExpensesItemComponent(expense)
      );
  });
  return (

  <div className="App">
      <header className="App-header">
        <ExpensesComponent/>
        <ul>{expensesList}</ul>
      </header>
    </div>

  );


}



export default App;
